import Jogador from '../Jogador'
import './Time.css'

const Time = (props) => {
    return (
        <section className='time' style={{ backgroundColor: props.corSecundaria }}>
            <h3 style={{ borderColor:props.corPrimaria }}>{props.nome}</h3>
            {props.jogadores.map( jogador => <Jogador />)}
        </section>
    )
}

export default Time
